import { Logout } from "features/user";
import React from "react";

export default function Home() {
return (<>
    <h1>홈페이지 화면 입니다~~</h1>
    {localStorage.length > 0 && <Logout/>}
    {localStorage.length == 0 ? <Logout/> :
        <> <button onClick = {() => history.push('/add')}>회원가입</button>
        <button onClick = {() => history.push('/login')}>로그인</button></>}
</>)
}
